import React from "react";

const NavBar = () => {
    return(
        <div className="navbar">
            <a href="#">HOME</a>
            <a href="#">ABOUT</a>
            <a href="#">SKILLS</a>
            <a href="#">CONTACT</a>
        </div>
    );
}
export default NavBar;
